import logo from './Images/logo2.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className='HeadingText'><h1 className='Tagline1'>We Build.</h1><h1> Apps & Games</h1></div>
      </header>
    </div>
  );
}

export default App;
